import React from "react";

function GameDetails({ casinogame, closeModal }) {
  return (
    <div className="game-details">
      <h2>{casinogame.name}</h2>
      <p>{casinogame.description}</p>
      <img src={casinogame.image} alt={casinogame.name} onClick={closeModal} />
    </div>
  );
}

export default GameDetails;
